        getGenderMens();
    }, [])

    const getGenderMens = function(){
        fetch('http://localhost:8080/countries/1')
        .then(res => res.json())
        .then(genderMens => setGenderMens(genderMens))
    }


    return (
        <> 
        <div className="main-container">
